    [],nt"revision_timestamp": "2015-09-26T20:16:19.686403",nt"name": "etopo1-1-arc-minute-global-relief-model",nt"isopen":
    false,nt"url": null,nt"notes": "In August 2008, the National Geophysical
    Data Center (NGDC), an office of the National Oceanic and Atmospheric Administration
    (NOAA), developed the ETOPO1 Global Relief Model as an improvement to the ETOPO2v2
    Global Relief Model. ETOPO1 is available in "Ice Surface" (top of Antarctic and
    Greenland ice sheets) and "Bedrock" (base of the ice sheets) versions. Both versions
    of ETOPO1 were generated from diverse global and regional digital data sets, which
    were shifted to common horizontal and vertical datums, and then evaluated and edited
    as needed. Bathymetric, topographic, and shoreline data used in ETOPO1 were obtained
    from NGDC, Antarctic Digital Database (ADD), European Ice Sheet Modeling Initiative
    (EISMINT), Scientific Committee on Antarctic Research (SCAR), Japan Oceanographic
    Data Center (JODC), Caspian Environment Programme (CEP), Mediterranean Science Commission
    (CIESM), National Aeronautics and Space Administration (NASA), National Snow and
    Ice Data Center (NSIDC), Scripps Institute of Oceanography (SIO), and Leibniz Institute
    for Baltic Sea Research (LIBSR). ETOPO1 is vertically referenced to sea level, and
    horizontally referenced to the World Geodetic System of 1984 (WGS 84). Cell size
    for ETOPO1 is 1 arc-minute.",nt"license_title": null,nt"extras": [{ntt"key":
